import { Row, Col } from "react-bootstrap";

export default function Dash2() {
  return (
    <div>
      <div>
        <Row className="border">
          <Col sm={4}>
            <Card></Card>
          </Col>
          <Col sm={4}></Col>
          <Col sm={4}></Col>
        </Row>
      </div>
    </div>
  );
}
